import {Button} from '@mui/material'

const Header = (props:any) => {

    const handleLogout = () => {
        localStorage.removeItem('token');
        props.setLoggedIn(false);
    };

    return(
            <Button onClick={handleLogout}>Logout</Button>
        )
}

export default Header;
